import React from "react";
// import styles from "../modules/TopPicks.module.css";

export default function TopPicks() {
  const EmojisList = [
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
    { s: "emoji", a: "Alink" },
  ];

  return (
    <div>
      {EmojisList.map((e, i, a) => {
        return (
          <a key={i} href={e.a} target="_blank">
            {e.s}
          </a>
        );
      })}
    </div>
  );
}
